const initialValue = {
    data: { email: "" }
}

const FetchEmail = (state = initialValue, action) => {
    switch (action.type) {
        case FetchEmail:
            return {
                ...state,
                data: {
                    ...state.data,
                    email: action.payload
                }
            }
        default: return state;
    }
}

export default FetchEmail;
